!function(){tinymce.PluginManager.add("BL_CSSP",function(e,t){e.addButton("BL_CSSP_button",{title:"CSSProgress",icon:"mce",onclick:function(){e.windowManager.open({title:"Insert a BlueLevel CSSProgress Progress Bar",body:[{type:"textbox",name:"per",label:"Progress Bar Percentage Value (without % sign)"},{type:"textbox",name:"title",label:"Title of the BlueLevel CSSProgress Bar"},{type:"listbox",name:"color",label:"Progress Bar Color",values:[{text:"Red",value:"red"},{text:"Orange",value:"orange"},{text:"Dark",value:"dark"},{text:"Lime",value:"lime"},{text:"Cyan",value:"cyan"},{text:"Navy",value:"navy"},{text:"Yellow",value:"yellow"}]},{type:"listbox",name:"style",label:"Progress Bar Styles",values:[{text:"StripedBar",value:"ruler-2"},{text:"HeatBar",value:"heat-gradient"},{text:"HoverBar",value:"move"},{text:"DottedBar(use dark colors)",value:"dots-pattern"}]}],onsubmit:function(t){e.insertContent('[BL_CSSProgress style="'+t.data.style+'" percentage="'+t.data.per+'" color="'+t.data.color+'" ]')}})}})})}();